(5, 0, 0, 0, 0, 'news-1-1102-3175.jpg', '{\"p\":\"news-1-1102-3175.jpg\",\"w\":270,\"h\":200,\"m\":\"image\\/jpeg\"}', 'chinh-sach-tra-hang', 'return-policy', '', '', '', '', 'Return policy', 'Chính sách trả hàng', 1, 'hienthi', 'chinh-sach', 1609287818, 1620827241, 3, NULL),
(6, 0, 0, 0, 0, 'news-1-4178-9067.jpeg', 'null', 'chinh-sach-bao-hanh', 'warranty-policy', '', '', '', '', 'Warranty Policy', 'Chính sách bảo hành', 2, 'hienthi', 'chinh-sach', 1609287823, 1609287842, 1, NULL),
(7, 0, 0, 0, 0, 'news-2-1467-6954.jpg', '', 'chinh-sach-mua-hang', 'purchase-policy', '', '', '', '', 'Purchase policy', 'Chính sách mua hàng', 3, 'hienthi', 'chinh-sach', 1609287848, 1609287867, 0, NULL),
(8, 0, 0, 0, 0, 'news-3-4960-6754.jpg', '', 'chinh-sach-nguoi-dung', 'user-policy', '', '', '', '', 'User policy', 'Chính sách người dùng', 4, 'hienthi', 'chinh-sach', 1609287874, 1609287892, 0, NULL),
(9, 0, 0, 0, 0, '', '', 'thanh-toan-tai-cong-ty', 'payment-at-the-company', '', '', '- Customers please pay directly at the company right after buying at\r\nShowroom 1: No. 103 - 105 Le Thanh Nghi - Dong Tam - Hai Ba Trung - Hanoi.\r\nShowroom 2: No. 58 Ho Tung Mau - Cau Giay - Hanoi.\r\n- As soon as you pay, the accountant will send you back the financial invoice and the sales staff will guide you on the form of delivery and receipt.', '- Quý khách hàng vui lòng thanh toán trực tiếp tại công ty ngay khi mua hàng tại\r\nShowroom 1 : Số 103 - 105 Lê Thanh Nghị– Đồng Tâm - Hai Bà Trưng– Hà Nội.\r\nShowroom 2 : Số 58 Hồ Tùng Mậu  – Cầu Giấy – Hà Nội.\r\n- Ngay khi quý khách thanh toán xong, nhân viên kế toán sẽ gửi lại quý khách hóa đơn tài chính và nhân viên kinh doanh sẽ hướng dẫn quý khách hình thức giao nhận hàng.', 'Payment at the company', 'Thanh toán tại công ty', 1, 'hienthi', 'hinh-thuc-thanh-toan', 1609287951, 1620819794, 0, NULL),
(10, 0, 0, 0, 0, '', '', 'thanh-toan-bang-chuyen-khoan', 'payment-by-bank-transfer', '', '', '- If the delivery place is suburban, suburban or inner city of Hanoi but different from the payment place (in case you send gifts, send goods to friends, partners ...) we will collect money 100% of the order value in advance + shipping fee calculated in the shipping policy by bank transfer method before shipment', '- Nếu địa điểm giao hàng là ngoại thành, ngoại tỉnh hoặc nội thành thành phố Hà Nội nhưng khác với địa điểm thanh toán (trong trường hợp Quý khách gửi quà, gửi hàng cho bạn bè, đối tác …) chúng tôi sẽ thu tiền trước 100% giá trị đơn hàng + phí vận chuyển theo cước phí tính trong chinh sách vận chuyển bằng phương thức chuyển khoản trước khi giao hàng', 'Payment by bank transfer', 'Thanh toán bằng chuyển khoản', 2, 'hienthi', 'hinh-thuc-thanh-toan', 1609287971, 1609287996, 0, NULL),
(11, 0, 0, 0, 0, '', '', 'thanh-toan-tai-diem-giao-hang', 'payment-at-the-point-of-delivery', '', '', '- You pay the forwarder for the whole or the rest of the purchased order value (if deposited).\r\n- This form of payment is only made for orders with a delivery address in Hanoi city (within a radius of 30 km from the place of purchase).\r\n- If the place of delivery is right at the place of payment, our delivery staff will collect the money upon delivery.', '- Quý khách thanh toán cho nhân viên giao nhận toàn bộ hoặc phần còn lại của giá trị đơn hàng đã mua (nếu đã đặt cọc)\r\n- Hình thức thanh toán này chỉ thực hiện với các đơn hàng có địa chỉ giao hàng tại nội thành thành phố Hà Nội (trong phạm vi bán kính 30 km tính từ nơi mua hàng).\r\n- Nếu địa điểm giao hàng ngay tại nơi thanh toán, nhân viên giao hàng của chúng tôi sẽ thu tiền khi giao hàng.', 'Payment at the point of delivery', 'Thanh toán tại điểm giao hàng', 3, 'hienthi', 'hinh-thuc-thanh-toan', 1609288000, 1609288028, 0, NULL),
